import classNames from "classnames";
import styles from "./styles.module.css";

export const PackageOption = ({label, checked, setValue}) => {

    return (
          <input
            type="checkbox"
            onChange={setValue}
            checked={checked}
            id={label}
            className={styles.toggle}></input>
    )
}
